import React, {useState} from 'react';

const Numbers = () => {
  const [numbers, setNumbers] = useState(['one','two','three'])
  return(
    <div>
    <h1>Numbers</h1>
    { numbers.map( num => {
      return <h4>{num}</h4>
    })}
    </div>
  )
}

export default Numbers;
